sidebarCSS:
#root.root {--tabs-height: 32px;}
#root.root {--tabs-margin: 4px;}
#root.root {--tabs-activated-bg: #665c54;}
#root.root {--tabs-activated-fg: #ebdbb2;}
#root.root {--frame-el-bg: #3c3836 !important;}

#root.root {--tabs-indent: 20px;}
#root.root {--general-margin: 4px;}
#root.root {--general-border-radius: 4px;}

#root.root {--tabs-activated-shadow: 0 1px 4px -1px rgba(0,0,0,0.282), inset 0 0 0 1px rgba(255,255,255,0.1);}


#root.root {--frame-el-overlay-selected-border: #ebdbb2;}
#root.root {--frame-fg: #ebdbb2;}

#root.root {--favicons-placeholder-bg: #a89984;}


#root.root {--tabs-fg: #bdae93;}
#root.root {--tabs-fg-hover: #fbf1c7;}
#root.root {--tabs-font: SF compact Rounded;}
#root.root {--tabs-selected-bg: #d79921;}
#root.root {--tabs-selected-fg: #282828;}



/* Center tabs on the collapsed view */
.ScrollBox:not(:hover) {
  --tabs-indent: 0px;
}

.ScrollBox:not(:hover) .Tab {
    transition: transform var(--d-fast),opacity var(--d-fast), padding var(--d-fast), padding-left .2s ease .25s !important;
}

.Tab {
		cursor: pointer;
    transition: transform var(--d-fast),opacity var(--d-fast), padding var(--d-fast), padding-left .2s ease .8s !important;
}

.Tab .body {
		box-shadow: 0 1px 4px -1px rgba(0,0,0,0.282), inset 0 0 0 1px rgba(255,255,255,0.03);
    transition: opacity var(--d-fast),transform var(--d-fast), background-color .2s ease;
}

.ScrollBox:not(:hover) .Tab .body::after {
    opacity: 0;
    transition: left .2s ease 2s, opacity .2s ease .25s;
    left: -10px;
}

.Tab .body::after {
	transition:opacity .2s ease 1s;
}


.Tab .fav:hover {
    transition: pointer-events .2s ease .8s !important;
}

.Tab .body { padding-left: 2px; }

/* Audio indicator on the favicon, unclickable */
.Tab .audio {
    top:6px !important;
    left:13px !important;
    z-index:21 !important;
    pointer-events: none;
    filter: drop-shadow(0px 0px 3px rgba(0,0,0,1)) !important;
}

.Tab[data-audible] .t-box, .Tab[data-muted] .t-box {
    transform: none;
}

/* Overflowing tab titles fading out */
.t-box {
    width: 250px;
}

/* More space between favicon and title */
.title { margin-left: 4px; }

.Tab .fav > .fav-icon { /* gives favicon dropshadow */
    width: var(32px);
    height: var(32px);
    filter: drop-shadow(1px 3px 2px rgba(0,0,0,0.2)) !important;
}


/* Border on the right */
.Sidebar {
    border-right: solid 1px #665c54;
}

.ScrollBox:not(:hover) .Tab[data-parent="true"] .fav .exp {
	left: -60px;
  opacity: 0;
}

.ScrollBox:hover .Tab[data-parent="true"] .fav .exp {
	left: -4px;
  opacity: 1;
  transition: left 0s ease .8s, opacity .2s ease .8s;
}



.Tab .fav>.child-count {
 right:-6px;
 bottom:-7px;
}

